import Axios, * as others from 'axios';
import React, { useEffect, useState } from "react";

function UserListPage({ socket }) {

  const [userList, setUserList] = useState([]);

  const getUserList = async () => {
    Axios.get("http://localhost:3031/read").then((response) => {
      setUserList(response.data);
    });
    await socket.emit("join_room");
  };

  useEffect(() => getUserList, []);

  return (


    <div className="container">

  <div className="row">
    <div className="col">
    First Name
    </div>
    <div className="col">
    Last Name
    </div>
    <div className="col">
    Email
    </div>
    <div className="col">
    Delete
    </div>

  </div>

  {userList.map((val, key) => {
        return (
          <div className="row" key={key}>
          <div className="col">
            {val.firstName}
          </div>
          <div className="col">
          {val.lastName}
          </div>
          <div className="col">
          {val.email}
          </div>

          <div className="col">
          <i className="bi bi-trash"></i>
          </div>
        </div>

        );
      })}

</div>


  );
}

export default UserListPage;
